import ExpenseItem from "./Expenseitem";
function Expenses(props) {
  return (
    <div>
      <ExpenseItem title={props.title[0]} amount={props.amount[0]} date={date} />
      <ExpenseItem title={props.title[1]} amount={amount} date={date} />
      <ExpenseItem title={props.title[2]} amount={amount} date={date} />
      <ExpenseItem title={props.title[3]} amount={amount} date={date} />
    </div>
  );
}
export default Expenses;
